import LandingPage from './pages/landingPage';
import Lists from './pages/Lists';
import List from './pages/List';
import NotFound from './pages/notFound';
import NewList from './pages/NewList';
import SignIn from './pages/SignIn';
import SignUp from './pages/SignUp';
import Prioritize from './pages/Prioritize';
import { Routes, Route } from 'react-router-dom';
import { useEffect, useState } from 'react';

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [user, setUser] = useState({});

  handleLogin = (data) => {
    setIsLoggedIn(true);
    setUser(data.user);
  };

const handleLogout = () => {
  setIsLoggedIn(false);
  setUser({});
  };

  const loginStatus = () => {
    fetch('http://localhost:3001/logged_in', 
   {withCredentials: true})    
.then(response => {
      if (response.data.logged_in) {
        handleLogin(response)
      } else {
        handleLogout()
      }
    })
    .catch(error => console.log('api errors:', error))
  };

  useEffect(() => {
    loginStatus()
  }, []);

  return (
    <div>
        <Routes>
          <Route exact path="/welcome" element={<LandingPage/>} user={user}/>
          <Route exact path="/signin" element={<SignIn/>} user={user}/>
          <Route exact path="/signup" element={<SignUp/>} user={user}/>
          { }
          <Route exact path="/lists" element={<Lists/>} user={user}/>
          <Route exact path="/lists/:id" element={<List/>} user={user}/>
          <Route exact path="/lists/new" element={<NewList/>} user={user}/>
          <Route exact path="/lists/:id/prioritize" element={<Prioritize/>} user={user}/>
          <Route path="*" element={<NotFound/>}/>
        </Routes>
      </div>
  );
}

export default App;
